	private GHAGrammarAccess grammarAccess;

	@Override
	protected InternalGHAParser createParser() {
		InternalGHAParser result = new InternalGHAParser(null);
		result.setGrammarAccess(grammarAccess);
		return result;
	}

	@Override
	protected TokenSource createLexer(CharStream stream) {
		return new GHATokenSource(super.createLexer(stream));
	}
	
	@Override
	protected String getRuleName(AbstractElement element) {
		return nameMappings.getRuleName(element);
	}

	@Override
	protected String[] getInitialHiddenTokens() {
		return new String[] { "RULE_WS", "RULE_ML_COMMENT", "RULE_SL_COMMENT" };
	}

	public GHAGrammarAccess getGrammarAccess() {
		return this.grammarAccess;
	}

